import React from 'react';

const Home = () => {
    return <h1 className="py-3">Home</h1>;
};

const Introduction = () => {
    return <h1 className="py-3">Introduction</h1>;
};
const Magictoys = () => {
    return <h1 className="py-3">Magictoys</h1>;
};

const Liedetector = () => {
    return <h3>Mobile Phone</h3>;
};

const Draw = () => {
    return <h3>Desktop PC</h3>;
};

export { Home, Introduction, Magictoys, Liedetector, Draw };
